import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
import SearchIcon from '@mui/icons-material/Search';
import { useFetch } from '../../hooks/useFetch';
import { createTheme, Pagination, TableBody, TableCell, TableHead, TableRow } from '@mui/material';
import { ThemeProvider } from '@mui/material/styles';
import { Box } from '@mui/system';

const url = "http://localhost:3000/serviceorders";

const theme = createTheme({
    palette: {
        primary: {
            main: '#2148C0'
        }
    }
});

export default function Content() {
    const { data: items, httpConfig, loading, error } = useFetch(url);
    // const shareInfoLen = items.length;
    // console.log(items.length);


    return (
        <ThemeProvider theme={theme}>
            <Paper sx={{ maxWidth: 936, margin: 'auto', overflow: 'hidden' }}>
                <AppBar
                    position="static"
                    color="default"
                    elevation={0}
                    sx={{ borderBottom: '1px solid rgba(0, 0, 0, 0.12)' }}
                >
                    <Toolbar>
                        <Grid container spacing={2} alignItems="center">
                            <Grid item>
                                <SearchIcon color="inherit" sx={{ display: 'block' }} />
                            </Grid>
                            <Grid item xs>
                                <TextField
                                    fullWidth
                                    placeholder="Procure por ID ou Nome do Técnico"
                                    InputProps={{
                                        disableUnderline: true,
                                        sx: { fontSize: 'default' },
                                    }}
                                    variant="standard"
                                />
                            </Grid>
                        </Grid>
                    </Toolbar>
                </AppBar>
                <TableHead>
                    <TableRow align="center">
                        <TableCell align="center">Ordem de Serviço</TableCell>
                        <TableCell align="center">Tempo de Serviço</TableCell>
                        <TableCell align="center">Data do Serviço</TableCell>
                        <TableCell align="center">SLA</TableCell>
                        <TableCell align="center">Acionamento</TableCell>
                        <TableCell align="center">Comissão</TableCell>
                        <TableCell align="center"></TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {currentItem.map((item, i) => (
                        <TableRow key={item.id}>
                            <TableCell align="center">{item.id}</TableCell>
                            <TableCell align="center">{item.title}</TableCell>
                            <TableCell align="center">{item.url}</TableCell>
                            <TableCell align="center">
                                <img
                                    src={item.thumbnailUrl}
                                    alt="img"
                                    width="40"
                                    height="40"
                                ></img>
                            </TableCell>
                        </TableRow>
                    ))}
                </TableBody>
                {/* <Typography sx={{ my: 5, mx: 2 }} color="text.secondary" align="center">
                    {loading && <p>Carregando dados...</p>}
                    {error && <p>{error}</p>}
                    <ul>
                        {items && items.map((serviceordes) => (
                            <li>
                                {serviceordes.id} - {serviceordes.start_service}
                            </li>
                        ))}
                    </ul>
                </Typography> */}
                <Box>
                    {/* <Typography>Total de OS's: {shareInfoLen}</Typography> */}
                    <Pagination count={10} variant="outlined" shape="rounded" color="primary" sx={{ mb: 1, mr: 2, display: "flex", justifyContent: "end" }} />
                </Box>
            </Paper>
        </ThemeProvider>
    );
}
